import React, { Component } from 'react';
import QuestionCard from '../components/QuestionCard';

class QuestionListPage extends Component {
  constructor(props) {
    super(props);
    this.handleClickNextPage = this.handleClickNextPage.bind(this);
  }

  handleClickNextPage() {
    const { history } = this.props;
    history.push('/new-question');
  }

  render() {
    const questions = [
      {
        id: 1,
        name: "Hermione",
        question: "Como fazer a poção polissuco?",
        claps: 7,
      },
    ];
    return (
      <section>
        {questions.map((question, index) => (
          <QuestionCard key={ index } question={ question } />
        ))}

        <button type="button" inClick={ this.handleClickNextPage }>
          Nova Pergunta
        </button>
      </section>
    )
  }
}

export default QuestionListPage;
